@mixin mabryA{
	font-size: 120px;
	line-height: 130%;
	font-family: 'Mabry Pro';
	font-weight: 900;
}
%mabryA{
	@include mabryA;
}
@mixin mabryB{
	font-size: 64px;
	line-height: 100%;
	font-family: 'Mabry Pro';
	font-weight: 900;
}
%mabryB{
	@include mabryB
}
@mixin mabryC{
	font-size: 36px;
	line-height: 140%;
	font-family: 'Mabry Pro';
	font-weight: 900;
}
%mabryC{
	@include mabryC;
}
@mixin mabryD{
	font-size: 24px;
	line-height: 140%;
	font-family: 'Mabry Pro';
	font-weight: 900;
}
%mabryD{
	@include mabryD;
}
@mixin mabryE{
	font-size: 14px;
	line-height: 113%;
	font-family: 'Mabry Pro';
	font-weight: 600;
}
%mabryE{
	@include mabryE;
}
@mixin mabryF{
	font-size: 12px;
	line-height: 113.5%;
	font-family: 'Mabry Pro';
	font-weight: normal;
}
%mabryF{
	@include mabryF;
}
@mixin mabryG{
	font-size: 10px;
	line-height: 113.5%;
	font-family: 'Mabry Pro';
	font-weight: normal;
}
%mabryG{
	@include mabryG;
}
@mixin mabryCardA{
	font-size: 24px;
	line-height: 27px;
	font-family: 'Mabry Pro';
	font-weight: 600;
}
%mabryCardA{
	@include mabryCardA;
}
@mixin mabryCardB{
	font-size: 18px;
	line-height: 20px;
	font-family: 'Mabry Pro';
	font-weight: normal;
	letter-spacing: 0.00em;
}
%mabryCardB{
	@include mabryCardB;
}

//AT APOC Styles
@mixin apocA{
	font-size: 36px;
	line-height: 130%;
	font-family: 'Mabry Pro';
	font-weight: 100;
}
%apocA{
	@include apocA;
}
@mixin apocB{
	font-size: 24px;
	line-height: 130%;
	font-weight: 100;
	font-family: 'Mabry Pro';
}
%apocB{
	@include apocB;
}
@mixin apocC{
	font-size: 16px;
	line-height: 130%;
	font-family: 'Mabry Pro';
}
%apocC{
	@include apocC;
}

//h1~h6
h1{
	@extend %mabryA;
}
h2{
	@extend  %mabryB;
}
h3{
	@extend  %mabryC;
}
h4{
	@extend  %mabryD;
}
h5{
	@extend  %mabryE;
}
h6{
	@extend  %mabryF;
}

